const SidebarData = [
  {
    id: 1,
    name: "Kuze Kere",
    icon: <Star />,
  },
  {
    id: 2,
    name: "Kuze Kere",
    icon: <Star />,
  },
  {
    id: 3,
    name: "Kuze Kere",
    icon: <Star />,
    subItem: [{ name: "Kuze Kere", icon: <Star /> }],
  },
];

const Menu = () => {
  return (
    <>
      {SidebarData.map((item) => {
        console.log(item);
      })}
    </>
  );
};

export default Menu;
